import { Link } from 'react-router-dom';
import Styles from "./Navbar.module.css";

const Dropdown = () => {
  return (
    <div className={Styles.dd}>
           <div><h5><a href="#">OLX Autos(Cars)</a></h5>
           <h5><a href="#">Properties</a></h5>
           <p><a href="#">For Sale: Houses & Aparmments</a></p>
           <p>For Rent: Houses & Apartments</p>
           <p>Lands & Plots</p>
           </div>
            <div>b</div>
            <div>c</div>
            <div>d</div>
    </div>
  )
}

export default Dropdown
